
CREATE USER app01user IDENTIFIED BY 'pwd';
GRANT SELECT ON dbCustomers.* TO 'app01user'@'%';
SELECT USER, ATTRIBUTE, COMMENT from INFORMATION_SCHEMA.USERS WHERE user='app01user';


use dbCustomers;

DROP TABLE customers;

CREATE ROWSTORE TABLE IF NOT EXISTS customers (
       id VARCHAR(36) NOT NULL primary key,
       first_name VARCHAR(100) NOT NULL,
       last_name VARCHAR(100) NOT NULL,
       gender VARCHAR(20) NOT NULL,
       birth_date DATETIME NOT NULL,
       address VARCHAR(100) NULL,
       document_type VARCHAR(20) NOT NULL,
       document_number VARCHAR(20) NOT NULL,
       email varchar(50) NOT NULL,
       phone varchar(50) NOT NULL,
       active bool NOT NULL default true,
       creation_timestamp TIMESTAMP NOT NULL,
       KEY (document_type,document_number)
) compression = sparse;

TRUNCATE TABLE customers;


CREATE ROWSTORE TABLE IF NOT EXISTS customers_phones (
      id VARCHAR(36) NOT NULL primary key,
      phone VARCHAR(50) NOT NULL,
      customer_id VARCHAR(36) NOT NULL,
      active bool NOT NULL default true,
      creation_timestamp timestamp NOT NULL
) compression = sparse;




